import styles from "./Todos.module.css";

function Todos({ todo, index, deleteTodo }) {
    return (
        <div className={styles.todo} onDoubleClick={() => deleteTodo(index)}>
            <div className={styles.todoText}>{todo}</div>
            </div>
    )
}

export default Todos;
